- uid: "com.azure.messaging.eventgrid.SystemEventNames.getSystemEventMappings()"
  fullName: "com.azure.messaging.eventgrid.SystemEventNames.getSystemEventMappings()"
  name: "getSystemEventMappings()"
  nameWithType: "SystemEventNames.getSystemEventMappings()"
  summary: "Get a mapping of all the system event type strings to their respective class."
  modifiers:
  - "static"
  syntax: "public static Map<String,Class<?>> getSystemEventMappings()"
  desc: "Get a mapping of all the system event type strings to their respective class. This is used by default in the <xref uid=\"com.azure.messaging.eventgrid.EventGridEvent\" data-throw-if-not-resolved=\"false\" data-raw-source=\"EventGridEvent\"></xref> and <xref uid=\"com.azure.core.models.CloudEvent\" data-throw-if-not-resolved=\"false\" data-raw-source=\"CloudEvent\"></xref> classes."
  returns:
    description: "a mapping of all the system event strings to system event objects."
    type: "<a href=\"https://docs.oracle.com/javase/8/docs/api/java/util/Map.html\">Map</a>&lt;<a href=\"https://docs.oracle.com/javase/8/docs/api/java/lang/String.html\">String</a>,<a href=\"https://docs.oracle.com/javase/8/docs/api/java/lang/Class.html\">Class</a>&lt;?&gt;&gt;"
type: "class"
desc: "This class contains a number of constants that correspond to the value of `eventType` of <xref uid=\"com.azure.messaging.eventgrid.EventGridEvent\" data-throw-if-not-resolved=\"false\" data-raw-source=\"EventGridEvent\"></xref>s and `type` of <xref uid=\"com.azure.core.models.CloudEvent\" data-throw-if-not-resolved=\"false\" data-raw-source=\"CloudEvent\"></xref>s, when the event originated from an Azure service. This list should be updated with all the service event strings. It also contains a mapping from each service event string to the model class that the event string corresponds to in the `data` field, which is used to automatically deserialize system events by their known string."
metadata: {}
